import React, { Component } from 'react';
import './styles/style.sass'

class Home extends Component {
    render() {
        return (
            <div class="home-content">
                <h1>Hello, I'm Collin Scott!</h1>
                <h2>A User Experience (UX) Designer</h2>
            </div>
        )
    }
}

export default Home;
